import logoLabenu from './components/Logo/logoLabenujpg.jpg';
import './App.css'



function App() {

  const titulo = 'Aprenda React com a Labenu!'

  const falarBoaNoite = () => {
    alert('Boa noite!')
  }

  return (
    <div className="App">
    <header>
      <h1>{titulo}</h1>
      <span>
        <img src={logoLabenu} alt="Logo da Labenu" />
      </span>
      </header>
      <span>
      </span>
      <div>
        <a href='https://www.labenu.com.br'>Site da Labenu!</a>
      </div>
      <button onClick={falarBoaNoite}>Clique aqui</button>
    </div>
  );
}

export default App;
